import React, { useState } from "react";
import Display from "./Display";
import Calculate from "./Calculate";
export default function Interface() {
  const [displayString, setdisplayString] = useState();
  return (
    <div>
      <div>
        <Display value={displayString} />
      </div>
      <div>
        <button
          onClick={() => {
            setdisplayString("this.displayString+1");
          }}
        >
          1
        </button>
        <button
          onClick={() => {
            setdisplayString("this.displayString + 2");
          }}
        >
          2
        </button>
        <button
          onClick={() => {
            setdisplayString(3);
          }}
        >
          3
        </button>
        <button
          onClick={() => {
            setdisplayString("+");
          }}
        >
          +
        </button>
        <br></br>
        <button
          onClick={() => {
            setdisplayString(4);
          }}
        >
          4
        </button>
        <button
          onClick={() => {
            setdisplayString(5);
          }}
        >
          5
        </button>
        <button
          onClick={() => {
            setdisplayString(6);
          }}
        >
          6
        </button>
        <button
          onClick={() => {
            setdisplayString("-");
          }}
        >
          -
        </button>
        <br></br>
        <button
          onClick={() => {
            setdisplayString(7);
          }}
        >
          7
        </button>
        <button
          onClick={() => {
            setdisplayString(8);
          }}
        >
          8
        </button>
        <button
          onClick={() => {
            setdisplayString(9);
          }}
        >
          9
        </button>
        <button
          onClick={() => {
            setdisplayString("/");
          }}
        >
          /
        </button>
        <br></br>
        <button
          onClick={() => {
            setdisplayString(0);
          }}
        >
          0
        </button>
        <button onClick={<Display value={" "} />}>AC</button>
        <button onClick={<Calculate value={displayString} />}>=</button>
        <button
          onClick={() => {
            setdisplayString("*");
          }}
        >
          x
        </button>
      </div>
    </div>
  );
}
